import React, { Component } from "react";
import { Grid, Container } from "semantic-ui-react";
import PageTitle from "../../PageTitle/PageTitle";
import Projects from "./Projects";
import skills from "./images/skills_white.png";
import "./style.css";
import { IconContext } from "react-icons";
import {
  FaPhp,
  FaReact,
  FaCss3Alt,
  FaHtml5,
  FaWordpress,
  FaGitAlt,
  FaGithub,
  FaSalesforce,
  FaBootstrap,
  FaMailchimp,
  FaUikit,
} from "react-icons/fa";
import {
  SiJavascript,
  SiJquery,
  SiVisualstudio,
  SiTailwindcss,
  SiGutenberg,
  SiAlpinedotjs,
  SiZapier,
  SiPhpmyadmin,
} from "react-icons/si";
import { GrMysql } from "react-icons/gr";
import AOS from "aos";
import "aos/dist/aos.css";

export default class Portfolio extends Component {
  componentDidMount() {
    AOS.init();
  }
  render() {
    return (
      <div>
        <Container id="portfolio">
          <div className="wrapper">
            <PageTitle title="My" />
          </div>
        </Container>
      </div>
    );
  }
}
